import React from 'react';
import { Diff, Hunk, Decoration, withSourceExpansion } from 'react-diff-view';
import 'react-diff-view/style/index.css';

const DiffWithSourceExpansion = withSourceExpansion(Diff);

const OldCode = `
// This is the old code
function add(a, b) {
  return a + b;
}
`;

const NewCode = `
// This is the new code
function add(a, b) {
  return a + b + 1; // Added 1 to the result
}
`;

const CodeDiff = () => (
  
  <DiffWithSourceExpansion
    viewType="split"
    oldSource={OldCode}
    newSource={NewCode}
    compareMethod={(lineFromFile1, lineFromFile2) => lineFromFile1 === lineFromFile2}
    renderHunk={(hunk, index) => (
      <Hunk key={index} hunk={hunk}>
        {({ lines, type }) => (
          <div>
            {lines.map((line, i) => {
              const { newLineNumber, oldLineNumber, type, content } = line;
              return (
                <Decoration key={i} type={type}>
                  {content}
                </Decoration>
              );
            })}
          </div>
        )}
      </Hunk>
    )}
  />
);

export default CodeDiff
